import MenuGov from 'component-library-gov/Menu';

export default function Menu() {
  return (
    <>
      <MenuGov collapse="800">
        <MenuGov.Group>
          <span>group1</span>
        </MenuGov.Group>
        <MenuGov.Item>item1</MenuGov.Item>
      </MenuGov>
    </>
  );
}
